import { motion } from "framer-motion";
import styled from "styled-components";
import ArticleListComponent from "../components/articeList.component";
import Topics from "../components/topics.component";
import SearchLayout from "../layout/search.layout";
import TopicsLayout from "../layout/topics.layout";

const SearchPageStyle = styled(motion.div)`
  display: flex;
  flex-direction: column;
  .articlesList {
    margin-top: 50px;
    position: relative;
    width: 93vw;
    left: 5vw;
    display: flex;
    flex-wrap: wrap;
  }
`;

const SearchPage = () => (
  <SearchPageStyle>
    <SearchLayout />
    <div className="articlesList">
      <ArticleListComponent /> <ArticleListComponent /> <ArticleListComponent />
      <ArticleListComponent />
    </div>
  </SearchPageStyle>
);

export default SearchPage;
